import React from 'react'

function Side_work() {
    useEffect(() => {
  const handleScroll = () => {
    console.log("Scrolling...");
  };

  window.addEventListener("scroll", handleScroll);

  return () => {
    window.removeEventListener("scroll", handleScroll);
  };
}, []);

  return (
    <div>Side_work</div>
  )
}

export default Side_work
